debug = pollDevice(w, wBar);

function debug = pollDevice(w, wBar)
    maxOutput = 20;
    targettedOutput = zeros(15, maxOutput);
    
    [version]=matleap_version;
    fprintf('matleap version %d.%d\n',version(1),version(2));
    fprintf("Recording...");
    
    % circshift around
    loop = 1;

    while true
        disp(loop);
        % grab frame
        f=matleap_frame;
        
        % extract key coordinates
        % place into a buffer
        % this is a single frame, need the whole targetted output
        targettedOutput(:, 1) = extractHandData(f);
        %disp(targettedOutput);
        debug = targettedOutput;
        % turn into a column, place into network
        processedData = columniseData(targettedOutput);
        disp(processedData);
        % put buffer into network
        % display output
        result = use_neural_network(processedData, w, wBar);
        
        interpret(result);
        
        % rotate the stuff out of 1st position
        targettedOutput = circshift(targettedOutput, 1, 2);
        
        loop = loop + 1;
        pause(0.02); % pause for 10ms
        
        if loop > 100
            break;
        end
    end
    
    function handData = extractHandData(frame)
        handData = zeros(15, 1);
        if isempty(frame.pointables)
            disp("Empty frame recording");
        else
            hand = nestedSortStruct(frame.pointables, 'id');
            for i=1:(length(hand))
                % 1, 2, 3 = 1 + 3 (i - 1) = 1
                % 4, 5, 6 = 1 + 3 (i - 1) = 4
                % 7, 8, 9 = 1 + 3 * 2 = 7

                k = 1 + 3 * (i - 1);

                handData(k:k+2) = hand(i).position;
                handData(k+1) = handData(k+1) - 300; % bring the y value down
                
            end
            handData = handData / 75; % normalise the data
        end
    end
end

function output = use_neural_network(X, w, wBar)
    
    bias = -1;

    X(301,:) = bias;

    activationVector1 = wBar * X; % X is input

    layer1 = arrayfun(@bipolarLogisticFunction, activationVector1);
    [v1Row, ~] = size(activationVector1);

    layer1(v1Row + 1, :) = bias;

    activationVector2 = w * layer1;

    layer2 = arrayfun(@bipolarLogisticFunction, activationVector2);

    disp("Classification is: ");
    disp(layer2);
    output = layer2;

    function output = bipolarLogisticFunction(v)
        output = (2 / (1 + exp(-v))) - 1;
    end
end

% turns a matrix into a single column
function output = columniseData(recording)
    [dRows, dCols] = size(recording);
    output = zeros(dRows * dCols, 1);
    %output = ones(dRows * dCols, 1);
    outputIndex = 1;
    for rowIndex = 1:dRows
        % I have this backwards, but I have the processed data already
        output(outputIndex: outputIndex + dCols - 1) = recording(rowIndex, :);
        % should be
        % output(outputIndex: outputIndex + dCols - 1) = recording(:, rowIndex);
        outputIndex = outputIndex + dCols;
    end
end

function interpret(result)
    % expectedLeft = [1, -1, -1, -1]';
    % expectedRight = [-1, 1, -1, -1]';
    % expectedUp = [-1, -1, 1, -1]';
    % expectedDown = [-1, -1, -1, 1]';
    
    addpath('pictures');
    
    [rRows, rCols] = size(result);
    output = zeros(rRows, rCols);
    
    for index = 1:rRows
        % convert all negatives to -1
        if result(index, 1) < 0
            output(index, :) = -1;
        % convert all positives to 1
        elseif result(index, 1) > 0
            output(index, :) = 1;
        % leave zeros alone
        end
    end
    
    cla(subplot(2, 2, 1));
    cla(subplot(2, 2, 2));
    cla(subplot(2, 2, 3));
    cla(subplot(2, 2, 4));
    
    if output(1, 1) == 1
        % swipe left
        [X1,map1]=imread('left.png');
        subplot(2,2,1), imshow(X1,map1)
    end
    if output(2, 1) == 1
        % swipe right
        [X2,map2]=imread('right.png');
        subplot(2,2,2), imshow(X2,map2)
    end
    if output(3, 1) == 1
        % swipe up
        [X3,map3]=imread('up.png');
        subplot(2,2,3), imshow(X3,map3)
    end
    if output(4, 1) == 1
        % swipe down
        [X4,map4]=imread('down.png');
        subplot(2,2,4), imshow(X4,map4)
    end
    
    drawnow;
    % display the appropriate picture or whatever
end